import React from "react";
import axios from "axios";

const WrapperComponent = (Component, type) => {
  return class extends React.Component {
    state = {
      data: {
        personal: null,
        address: null,
        employment: null,
      },
    };

    componentDidMount() {
      this.getData();
    }

    getData = () => {
      axios
        .get("http://jsonplaceholder.typicode.com/users")
        .then((response) => {
          const data = response.data[0],
            { name, email, username, website } = data,
            personal = {
              name: name,
              email: email,
              username: username,
              website: website,
            };

          this.setState({ personal: personal });
        })
        .catch();
    };

    render() {
      return (
        <div>
          <Component data={this.state.personal} />
        </div>
      );
    }
  };
};

export default WrapperComponent;
